import classNames from 'classnames/bind';
import styles from './Button.module.scss';

const cx = classNames.bind(styles);

function Button({ to, href, children, onClick }) {
    let Comp = 'button';
    return (
        <Comp classNames={cx('wrapper')}>
            <spn>{children}</spn>
        </Comp>
    );
}

export default Button;
